driver = GraphDatabase.driver(host, auth=("neo4j", password))


def fetchNodes():

    with driver.session() as session:

        results = session.run(
            '''MATCH (token:Sentence)
            RETURN token
        ''')

        nodes = []
        for count, record in enumerate(results):
            nodes.append({
                "token": record["token"]["text"]
            })

        import json
        jsonArray = json.dumps(nodes)
        print(jsonArray)

        return jsonArray


def uuidGenerator(text):

    uuid_id = uuid.uuid4()

    with driver.session() as session:

        results = session.run(
            '''MATCH (node:Sentence)
            WHERE node.text = '{text}'
            SET node.uuid = '{uuid_id}'
            RETURN node
            '''.format(text=text, uuid_id=uuid_id)
            )
        print('UUID was set: ', uuid_id)

